import bs4
import requests

def getDataFromFBRM():
    equipos = {}
    equipos['Senior'] = ['748', '1864', '3372', '', 'E89D4ECB', '']
    equipos['Cadete'] = ['754' ,'1863', '3369', '', 'E89D4ECB', '']
    equipos['Infantil'] = ['756', '1867', '3386', '', 'E89D4ECB', '']
    equipos['Alevin'] = ['761', '1885', '3419', '', 'E89D4ECB', '']
    #equipos['benjamin'] = ['762', '1891', '3439', '', 'E89D4ECB', '']


    url = "https://www.fbrm.org/competicion-309/competiciones-fbrm.aspx"

    partidos = []

    for equipo, values in equipos.items():

        form_data = {}
        form_data['ctl00$TBBusquedaCab'] = 'Texto de búsqueda'
        form_data['__EVENTTARGET'] = 'ctl00$contenedor_informacion$DDLCategorias'
        form_data['__EVENTARGUMENT'] = ''
        form_data['__LASTFOCUS'] = ''
        form_data['ctl00$contenedor_informacion$DDLCategorias'] = values[0]
        form_data['ctl00$contenedor_informacion$DDLFases'] = values[1]
        form_data['ctl00$contenedor_informacion$DDLGrupos'] = values[2]

        form_data['__VIEWSTATE'] = values[3]
        form_data['__VIEWSTATEGENERATOR'] = values[4]
        form_data['__EVENTVALIDATION'] = values[5]
        r = requests.post(url, form_data)

        html = r.text

        soup = bs4.BeautifulSoup(html, "html.parser")
        div_proximos_partidos = soup.find(id = "contenedor_informacion_PUltimaJornada")

        rows_in_table = div_proximos_partidos.find_all('tr')

        for row in rows_in_table:

            if('FUENTE' in row.text):

                cells_in_row = row.find_all('td')
                data_partido = [equipo]
                for cell in cells_in_row:
                    data_partido.append(cell.get_text())
                partidos.append(data_partido)
    respuesta = ['<div id = "contenidoACoger"><table id="resultados_tabla"><tr><th>Equipo</th><th>Jornada</th><th>Equipo Local</th><th></th><th></th><th>Equipo Visitante</th></tr>']
    for partido in partidos:

        equipo = partido[0]
        jornada = partido[1]
        res_local = partido[2]
        equipo_local = partido[3]
        equipo_visitante = partido[4]
        res_visitante = partido[5]

        respuesta.append('<tr><td>'+equipo+'</td><td>'+jornada+'</td><td>'+equipo_local+'</td><td>'+res_local+'</td><td>'+res_visitante+'</td><td>'+equipo_visitante+'</td></tr>')

    respuesta.append("</table></div>")

    return("\n".join(respuesta))

